import React from "react";

const SKILLS = [
  {
    id: "aws",
    name: "AWS",
    url: "https://aws.amazon.com/",
    svg: (
      <svg viewBox="0 0 48 48" className="w-12 h-12" aria-hidden>
        <path d="M6 34c6-8 20-8 28-8s22 0 28 8v2H6v-2z" fill="#FF9900" opacity="0.12" transform="scale(.72)"/>
        <path d="M11 28c6-6 20-6 26-6s20 0 26 6" fill="none" stroke="#FF9900" strokeWidth="2" strokeLinecap="round" transform="scale(.72)"/>
      </svg>
    ),
  },
  {
    id: "css",
    name: "CSS3",
    url: "https://developer.mozilla.org/en-US/docs/Web/CSS",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <path d="M12 6l4 44 20 6 20-6 4-44H12z" fill="#1572B6"/>
        <path d="M32 20h10l-1 10H32v10l-8-4" fill="#fff" opacity="0.12"/>
      </svg>
    ),
  },
  {
    id: "react",
    name: "React.JS",
    url: "https://reactjs.org/",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <g fill="none" stroke="#61DAFB" strokeWidth="2">
          <ellipse cx="32" cy="32" rx="18" ry="6"/>
          <ellipse cx="32" cy="32" rx="6" ry="18" transform="rotate(60 32 32)"/>
          <ellipse cx="32" cy="32" rx="6" ry="18" transform="rotate(120 32 32)"/>
        </g>
        <circle cx="32" cy="32" r="3" fill="#61DAFB"/>
      </svg>
    ),
  },
  {
    id: "html",
    name: "HTML",
    url: "https://developer.mozilla.org/en-US/docs/Web/HTML",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <img src="https://skillicons.dev/icons?i=html" />
      </svg>
    ),
  },
  {
    id: "java",
    name: "Java",
    url: "https://www.oracle.com/java/",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <path d="M28 12s8 2 8 8-8 8-8 8" stroke="#D14836" strokeWidth="2" strokeLinecap="round" fill="none"/>
        <path d="M18 44c2-2 12-6 24 0 0 0-8 8-24 0z" fill="#007396"/>
      </svg>
    ),
  },
  {
    id: "js",
    name: "Javascript",
    url: "https://developer.mozilla.org/en-US/docs/Web/JavaScript",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <rect x="10" y="10" width="44" height="44" rx="6" fill="#F7DF1E"/>
        <text x="32" y="42" textAnchor="middle" fontSize="20" fontWeight="700" fill="#000">JS</text>
      </svg>
    ),
  },
  {
    id: "node",
    name: "Node.JS",
    url: "https://nodejs.org/",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <path d="M32 10l18 10v20l-18 10L14 40V20z" fill="#3C873A"/>
        <path d="M34 30c-1.2.4-2.4.8-3.6 1.2" stroke="#fff" strokeWidth="1" strokeLinecap="round"/>
      </svg>
    ),
  },
  {
    id: "python",
    name: "Python",
    url: "https://www.python.org/",
    svg: (
      <svg viewBox="0 0 64 64" className="w-12 h-12" aria-hidden>
        <path d="M22 10h20v12a6 6 0 01-6 6h-8v-6h10" fill="#ffd43b"/>
        <path d="M42 54H22V42a6 6 0 016-6h8v6H26" fill="#306998"/>
      </svg>
    ),
  },
];

export default function SkillsSection() {
  return (
    <section id="skills" className="py-20 bg-[#030417] text-white">
      <div className="max-w-6xl mx-auto px-6 text-center">
        <p className="text-sm uppercase tracking-widest text-[var(--accent)]">Experience</p>
        <h3 className="mt-3 mb-10 text-3xl sm:text-4xl font-display font-bold">Skills</h3>

        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 gap-12 md:gap-16 justify-items-center">
          {SKILLS.map((s) => (
            <div key={s.id} className="flex flex-col items-center gap-4">
              <a
                href={s.url}
                target="_blank"
                rel="noopener noreferrer"
                title={s.name}
                className="w-24 h-24 rounded-full flex items-center justify-center bg-[#0e1624] border border-white/6 transition transform hover:-translate-y-1 hover:shadow-glow"
                aria-label={s.name}
              >
                <div className="w-12 h-12 text-center">{s.svg}</div>
              </a>
              <div className="text-sm text-gray-300">{s.name}</div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
